import React from "react";
import "./App.css";
import listing from "./listing.json";
import Table from "./Table";

function GetJson() {
  return [
    {
      id: 1,
      name: "dominic",
      age: 3,
    },
    {
      id: 2,
      name: "ed",
      age: 32,
    },
    {
      id: 3,
      name: "kimin",
      age: 36,
    },
  ];
}

class App extends React.Component {
  render() {
    const data = GetJson();
    return (
      <div className="container">
        <Table itemData={data} />
      </div>
    );
  }
}

function AppF() {
  let data = GetJson();

  return (
    <div>
      {listing.map((item) => {
        return (
          <div key={item.adurl}>
            <h3>Person:</h3>
            <ul>
              <li>{item.make}</li>
              <li>{item.year}</li>
            </ul>
          </div>
        );
      })}
    </div>
  );
}

export default App;
